#Melchizedek " Jesus Christ, the son of God..from..the aeons, that he might (pass through) all of the aeons, and (see) in each one of the aeons the nature of the aeon, as to what (kind) it is, and that he might put on as a garment sonship and goodness. O brother...their end...and he will (reveal to them) the truth...proverbs...at first in parables (and riddles)...(when he) proclaims them, Death will be troubled and become angry, not only he himself but also his (fellow) world-ruling archons and the principalities and authorities, the female gods and the male gods, together with the archangels, and the...all...world rulers...about him and about..and..they will...hidden mysteries...(scandal) from..the All. They will...(because of) this, while the (righteous will) bury him in haste. (They will) call him "the impious man" and "the (impure) transgressor of the law".
But (on) the (third) day he (will rise from the) dead...and...them...the holy disciples. And the Savior will (reveal) to them (the word) that gives life to the (All). And those in (heaven), those on Earth, and those under Earth, pronounced the word...(which) will happen in his name. <Furthermore>, they will say of him, "He was not born," though he was born;
"he does not eat," though he does eat;
"he does not drink," though he does drink;
"he is not circumcised" though he was circumcised;
" he is without real flesh," though he came in the flesh;
" he did not suffer death," <though> he did endure suffering;
" he did not rise from the dead," <though> he did rise from the dead. (But) all the (tribes) and all (the peoples) will speak ( the truth), who are recieving from (you yourself), O (Melchize)d(ek), holy one and high priest, the perfect and the (gifts of) life.. #NagHammadi (Gnostic Scriptures)

